n// \u8f38\u51fa example \u5be6\u4f8b\u7684 prefix \u5c6c\u6027 \nconsole.log(example.prefix); // \u8f38\u51fa\uff1a'My'",Po=e("https://www.typescriptlang.org/play/?jsx=0&module=0&ts=5.7.3&filetype=ts#code/PTAEiztRK--OgF35QCAxoAvL0Avm5mfbcQ5gOlUwBoyniAcCwZCYRiJNpQHhRYSlqB+HgAO4iglg2QGXZcPmgQAc8YAvxVl8vFAraCIWvTMgmlYjBwxBYj0sjlGtmlpI2tJBsNgCx-lGTJFAA"),Jo="// \u5b9a\u7fa9\u4e00\u500b\u65b9\u6cd5\u88dd\u98fe\u5668\uff0c\u7528\u65bc\u8a18\u9304\u65b9\u6cd5\u547c\u53eb\u53ca\u5176\u7d50\u679c \nfunction logMethod(target: any, key: string, descriptor: PropertyDescriptor) { \n  // \u4fdd\u5b58\u5c0d\u539f\u59cb\u65b9\u6cd5\u7684\u5f15\u7528 \n  const originalMethod = descriptor.value; \n  \n  // \u4fee\u6539\u63cf\u8ff0\u7b26\u4e2d\u7684\u65b9\u6cd5\u4ee5\u8a18\u9304\u547c\u53eb\u548c\u7d50\u679c \n  descriptor.value = function (...args: any[]) { \n    // \u8a18\u9304\u65b9\u6cd5\u540d\u548c\u5176\u53c3\u6578 \n    console.log(`\u547c\u53eb ${key} \u8207\u53c3\u6578\uff1a${args.join(', ')}`); \n    // \u547c\u53eb\u539f\u59cb\u65b9\u6cd5\u4e26\u4fdd\u5b58\u7d50\u679c \n    const result = originalMethod.apply(this, args); \n    // \u8a18\u9304\u65b9\u6cd5\u547c\u53eb\u7684\u7d50\u679c \n    console.log(`\u65b9\u6cd5 ${key} \u8fd4\u56de\uff1a${result}`); \n    // \u8fd4\u56de\u539f\u59cb\u65b9\u6cd5\u7684\u7d50\u679c \n    return result; \n  }; \n  \n  // \u8fd4\u56de\u4fee\u6539\u5f8c\u7684\u63cf\u8ff0\u7b26 \n  return descriptor; \n} \n\n// \u5b9a\u7fa9\u4e00\u500b\u5c07\u4f7f\u7528 logMethod \u88dd\u98fe\u5668\u7684\u985e\u5225 \nclass Calculator { \n  // \u61c9\u7528\u88dd\u98fe\u5668\u4ee5\u8a18\u9304\u5c0d add \u65b9\u6cd5\u7684\u547c\u53eb \n  @logMethod \n  add(a: number, b: number): number { \n    return a + b; \n  } \n} \n\n// \u5275\u5efa Calculator \u985e\u5225\u7684\u4e00\u500b\u5be6\u4f8b \nconst calculator = new Calculator(); \n\n// \u5728 calculator \u5be6\u4f8b\u4e0a\u547c\u53eb add \u65b9\u6cd5 \ncalculator.add(2, 3); // \u7531\u65bc\u88dd\u98fe\u5668\u768